import React from "react";
//import { Button } from "/components/ui/button";
import { Button,Card} from 'antd';
//import { Card, CardContent } from "./components/ui/card";
import { Phone, Mail, MapPin } from "lucide-react";
import background from '../images/Ekaritservice1.jpg';
import background2 from '../images/Ekaritphoto.jpg';
import { Link } from "react-router-dom";
import { motion } from "framer-motion";

const cardVariants = {
  hidden: { opacity: 0, y: 40 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.5 } },
};

const services = [
  {
    title: "Analysis & Design Process",
    description:
      "Business Process Analysis, Data Analysis, Process Re-engineering, System Design, Database Design, Prototype",
    icon: <Cpu size={40} className="text-orange-500" />,
  },
  {
    title: "Website Development",
    description:
      "Web Design, UI/UX, Mobile Responsive, Mobile App Design, Static Website, CMS - Content Management System, SEO Service",
    icon: <Lightbulb size={40} className="text-orange-500" />,
  },
  {
    title: "Application Development",
    description:
      "Web-based Application Development in Microsoft dotNet or Laravel Framework, API First Application using JavaScript and Server-side Framework, iOS and Android Application",
    icon: <Server size={40} className="text-orange-500" />,
  },
   {
    title: "Analysis & Design Process",
    description:
      "Business Process Analysis, Data Analysis, Process Re-engineering, System Design, Database Design, Prototype",
    icon: <Cpu size={40} className="text-orange-500" />,
  },
  {
    title: "Website Development",
    description:
      "Web Design, UI/UX, Mobile Responsive, Mobile App Design, Static Website, CMS - Content Management System, SEO Service",
    icon: <Lightbulb size={40} className="text-orange-500" />,
  },
  {
    title: "Application Development",
    description:
      "Web-based Application Development in Microsoft dotNet or Laravel Framework, API First Application using JavaScript and Server-side Framework, iOS and Android Application",
    icon: <Server size={40} className="text-orange-500" />,
  },
];

const Home: React.FC = () => {
  return (
    
<div className="min-h-screen bg-white text-gray-800">
      {/* Header */}
     <header className="bg-[#1c1c1e] text-white p-6 shadow-md">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-2xl font-bold">Ekarit Visa Service</h1>
          <nav className="space-x-6">
            {/*}<Link to="/services" className="hover:underline">Services</Link>
            <Link to="/about" className="hover:underline">About</Link>
            <Link to="/contact" className="hover:underline">Contact</Link>*/}
            <a href="#home" className="hover:underline">Home</a>
             <a href="#services" className="hover:underline">Services</a>
            <a href="#about" className="hover:underline">About</a>
            <a href="#contact" className="hover:underline">Contact</a>
          </nav>
        </div>
      </header>
      
     <section className="w-full flex flex-col md:flex-row justify-center items-center gap-8 p-8">
      <img
        src={background2}
        alt="Ekarit 1"
        className="w-1/2 h-auto object-contain"
      />
     <div className="flex flex-col gap-6">
      <motion.div
  variants={cardVariants}
  initial="hidden"
  animate="visible"
  whileHover={{ scale: 1.05 }}
>
    <Card
      key={1}
      className="w-[400px] h-auto p-8 bg-[#1c1c1e] rounded-2xl shadow-lg text-white text-center"
    >
      <h1 className="text-4xl font-bold">Welcome to Our Service</h1>
      <p className="mt-4 text-lg">We deliver quality with speed.</p>
    </Card>
</motion.div>

<motion.div
  variants={cardVariants}
  initial="hidden"
  animate="visible"
  whileHover={{ scale: 1.05 }}
>
    <Card
      key={3}
      className="w-[400px] h-auto p-8 bg-[#2b2b2e] rounded-2xl shadow-lg text-white text-center"
    >
      <h1 className="text-3xl font-semibold">Another Highlight</h1>
      <p className="mt-4 text-base">Explore more with our extended services.</p>
    </Card>
    </motion.div>
  </div>
     
    </section>

    <section id="service" className="py-16 bg-white">
        <div className="min-h-screen bg-yellow-400 text-white px-4 py-12">
      <div className="text-center mb-10">
        <h1 className="text-4xl font-bold">
          The Services you can get from our company are:
        </h1>
      </div>
    
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 max-w-6xl mx-auto">
        {services.map((service, idx) => (
          <motion.div
      variants={cardVariants}
      initial="hidden"
      animate="visible"
      whileHover={{ scale: 1.05 }}
    >
          <Card
            key={idx}
            className="bg-[#1c1c1e] rounded-2xl shadow-lg text-white text-center hover:shadow-xl transition-shadow duration-300"
            bodyStyle={{ padding: "30px" }}
          >
            <div className="flex justify-center mb-4">{service.icon}</div>
            <h3 className="text-xl font-bold mb-3">{service.title}</h3>
            <p className="text-sm text-gray-300">{service.description}</p>
          </Card>
          </motion.div>
        ))}
      </div>
    </div>
    </section>

      {/* Footer 
      <footer className="bg-yellow-400 text-white text-center py-6">
        <p>&copy; {new Date().getFullYear()} ServicePro. All rights reserved.</p>
      </footer>*/}
    </div>
  );
};

export default Home;
